/** @format */

import React from "react";
import styled from "styled-components";

const MenuBlock = styled.div`
  width: 100%;
  height: 20vh;
  position: relative;
  margin-bottom: 5vh;
`;

const MenuBox = () => {
  return <MenuBlock></MenuBlock>;
};

export default MenuBox;
